import React, { Component } from 'react';
import Row from 'react-bootstrap/lib/Row';
import Col from 'react-bootstrap/lib/Col';

class GreenCard extends Component {
  render() {
    return (
      <Row className="card-green text-sans">
        <Col sm={8}>
          <Row md={12} className="white soft-top">It’s no secret that a plant-based diet is good for you. Taking that extra step to eliminate animal products — for good — will make you look and feel absolutely fantastic!
          </Row>
          <Row className="white" >Find good recipes. You don’t need to go out and buy a bunch of new cookbooks, although that’s certainly an option. But again, you will have vegy.</Row>
        </Col>
      </Row>
    )
  }
}
export default GreenCard;
